import React from 'react'
import TextField from '@mui/material/TextField';
import Radio from '@mui/material/Radio';
import FormControlLabel from '@mui/material/FormControlLabel';
import RadioGroup from '@mui/material/RadioGroup';
import FormLabel from '@mui/material/FormLabel';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Select from '@mui/material/Select';
import OutlinedInput from '@mui/material/OutlinedInput';
import ListItemText from '@mui/material/ListItemText';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';
import { Formik, Form } from 'formik';

// Hobbies 
const ITEM_HEIGHT = 38;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
    PaperProps: {
        style: {
            maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
            width: 250,
        },
    },
};

const hobbiesNames = [
    'Oliver Hansen',
    'Van Henry',
    'April Tucker',
    'Ralph Hubbard',
    'Omar Alexander',
    'Carlos Abbott',
    'Miriam Wagner',
    'Bradley Wilkerson',
    'Virginia Andrews',
    'Kelly Snyder',
];


const Input = () => {

    // country 
    const [country, setcountry] = React.useState('');

    const handleChangeCountry = (event) => {
        setcountry(event.target.value);
    };


    // Hobis 
    const [hobbiesName, sethobbiesName] = React.useState([]);

    const handleChangeHobbies = (event) => {
        const {
            target: { value },
        } = event;
        sethobbiesName(
            // On autofill we get a stringified value.
            typeof value === 'string' ? value.split(',') : value,
        );
    };



    return (
        <div className='container'>


            <Formik>

                {(props) => (
                    <Form>

                        <TextField id="outlined-basic" label="User Name" variant="outlined" fullWidth />
                        <br></br>
                        <br></br>
                        <TextField id="outlined-multiline-static" label="Address" multiline rows={4} fullWidth />
                        <br></br>
                        <br></br>
                        <FormControl>
                            <FormLabel id="demo-row-radio-buttons-group-label">Gender</FormLabel>
                            <RadioGroup row aria-labelledby="demo-row-radio-buttons-group-label" name="row-radio-buttons-group">
                                <FormControlLabel value="female" control={<Radio />} label="Female" />
                                <FormControlLabel value="male" control={<Radio />} label="Male" />
                                <FormControlLabel value="other" control={<Radio />} label="Other" />
                            </RadioGroup>
                        </FormControl>
                        <br></br>
                        <br></br>
                        <FormControl fullWidth>
                            <InputLabel id="demo-simple-select-label">country</InputLabel>
                            <Select labelId="demo-simple-select-label" id="demo-simple-select" value={country} label="country" onChange={handleChangeCountry}>
                                <MenuItem value='India'>India</MenuItem>
                                <MenuItem value='Us'>Us</MenuItem>
                                <MenuItem value='UK'>UK</MenuItem>
                                <MenuItem value='China'>China</MenuItem>
                                <MenuItem value='Pakistan'>Pakistan</MenuItem>
                            </Select>
                        </FormControl>
                        <br></br>
                        <br></br>
                        <FormControl sx={{ m: 1, width: 300 }}>
                            <InputLabel id="demo-multiple-checkbox-label">Hobbies & Interest</InputLabel>
                            <Select labelId="demo-multiple-checkbox-label" id="demo-multiple-checkbox" multiple value={hobbiesName} onChange={handleChangeHobbies}
                                input={<OutlinedInput label="Hobbies & Interest" />}
                                renderValue={(selected) => selected.join(', ')} MenuProps={MenuProps}>
                                {hobbiesNames.map((name) => (
                                    <MenuItem key={name} value={name}>
                                        <Checkbox checked={hobbiesName.indexOf(name) > -1} />
                                        <ListItemText primary={name} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                        <br></br>
                        <Button type='submit' variant="contained">Submit</Button>

                    </Form>
                )
                }
            </Formik>

        </div>
    )
}

export default Input
